import React from "react";
import Avatar from "../../../Avatar/Avatar";
import Styles from "./AvatarCollection.module.css";
import { Carousel } from "react-bootstrap";
export default function AvatarCollection(props) {
	const { amount } = props;
	let AvatarArrSize = [];
	for (let i = 0; i < amount; i++) {
		AvatarArrSize.push(0);
	}
	return (
		<div className={Styles.container}>
			{/* <label className={Styles.next}></label>
			{AvatarArrSize.map((a, index) => {
				return (
					<div key={index}>
						<Avatar></Avatar>
					</div>
				);
			})}
			<label className={Styles.previous}></label> */}
			<Carousel>
				<Carousel.Item>
					<div style={{ display: "flex" }}>
						{" "}
						<Avatar></Avatar>
						<Avatar></Avatar>
						<Avatar></Avatar>
						<Avatar></Avatar>
					</div>
				</Carousel.Item>
				<Carousel.Item>
					<Avatar></Avatar>
				</Carousel.Item>
				<Carousel.Item>
					<Avatar></Avatar>
				</Carousel.Item>
				<Carousel.Item>
					<Avatar></Avatar>
				</Carousel.Item>
			</Carousel>
		</div>
	);
}
